@implementation ZeroWingAlert
- (BOOL)shouldAnimate
{
    return YES;
}
- (void)beginIteration:(id)event rect:(Int4)r
{
    _iteration++;
}

- (int)preferredWidth
{
    return 480;
}
- (int)preferredHeight
{
    if (!_text) {
        return 288;
    }
    id bitmap = [Definitions bitmapWithWidth:1 height:1];

    int textWidth = 480 - 89 - 18;
    id text = [bitmap fitBitmapString:_text width:textWidth];
    int textHeight = [bitmap bitmapHeightForText:text];
    int h = 24 + textHeight + 21 + 21 + 28;
    if (h > 288) {
        return h;
    }
    return 288;
}
- (void)handleBackgroundUpdate:(id)event
{
    if (_x11WaitForFocusOutThenClose) {
        if (_didFocusOut) {
            if (_backgroundCount > 1) {
                exit(0);
            }
        }
    }
    _backgroundCount++;
}
- (void)drawInBitmap:(id)bitmap rect:(Int4)r
{
    [bitmap setColor:@"black"];
    [bitmap fillRect:r];
    char *palette = "b #000000\n. #ffffff\n";
    {
        int frame = _iteration / 10;
        frame = frame % 4;
        unsigned char *pixels;
        unsigned char *palette;
        if (frame == 0) {
            palette = zeroWingPalette1;
            pixels = zeroWingPixels1;
        } else if (frame == 1) {
            palette = zeroWingPalette2;
